script: |
  super -f text -I q7150.spq | sort > q7150.out

inputs:
  - name: q7150.spq
    data: |
      SELECT * FROM tab1 (FORMAT parquet) AS cor0 WHERE + 12 NOT BETWEEN col2 - CAST ( - ( ( col2 ) ) AS INTEGER ) AND - col0;
  - name: tab1

outputs:
  - name: q7150.out
    data: |
      51	14	96
      85	5	59
      91	47	68
